    itemId: number;
}

const ItemDetailContainer = ({itemId}: IProps) => {
  const [helado,setHelado] = useState<DtItem | null>(null);

  useEffect(() => {
    getItem(itemId,setHelado);
  }, []);
  
  return <div>

  </div>;
}

export default ItemDetailContainer;
